const Footer = () => {
    return (
        <footer className="bg-indigo-900 py-6 px-4 border-t border-indigo-800">
            <div className="container mx-auto max-w-4xl text-center">
                <p className="text-indigo-300 text-sm mb-2">
                    このサイトは現世と異界の狭間でも閲覧可能なよう最適化されています
                </p>
                <p className="text-indigo-400 text-xs">
                    &copy; 2025 伝説の占い師 - 古の叡智と現代科学の融合
                </p>
            </div>
        </footer>
    );
};

export default Footer;
